favorite parts from the tour in Sydney that she released since I didn't actually film at my show and I took only like one picture 🥺 I am very excited and proud with how this video turned out (the music in it is actually I Wish You Would but in reverse and slowed down and I love how dark it sounds!).
.
.
I got to experience the tour with my sister - it was her second time seeing Taylor - and i will never get over just how shocking it was to actually see Taylor! I know I didn't like IKYWT, Bad Blood, love story, and shake it off (I think the show ended perfectly with OOTW!) BUT I ABSOLUTELY LOVED HYGTG, ENCHANTED/WILDEST DREAMS, AND OOTW. We were in the nose bleeds but we didn't care, it was still so amazing and my sister always tells me how she'll never forget seeing me cry during ootw. Knowing that the show was basically over after that song and that Taylor would be taken away from me just made it all the more depressing lol but I love that song so much and we got the paper airplane confetti! It was MAGICAL!! I really hope I get to see another show again one day but if not, that's ok too because 1989 was E-P-I-C.
.
.
